import React, { Component } from 'react';
import Link from "next/link";
import styles from "./navbar.module.css";
import { showDiv } from '../lib/menu'

const Menu = [
    {
      path: "/blog", name: "Blog",
    },
    {
      path: "/#", name: "100DaysofCode",
    },

    ]

class NavBarState extends Component {
state = {
    menu : false
};


openNav = () => {
  this.setState({
      menu : true
  })
  };


  tick() {
    this.setState({
      date: new Date()
    });
  }

  closeNav = () => {
    if (
        document.getElementById("menu_mobile") 
      ) {
          document.getElementById('menu_mobile').style.display = "block";
        }
  };


    render() {
        return (
            <header className={styles.header_Wrapper}>
            <div className={styles.div_top_hypers}>
              <div className={styles.logo_left}>NdV</div>
              <ul className={styles.ul_top_hypers}>
               {Menu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>

               ))} 
                </ul>
                 </div>
                 <div className={styles.menu_right}><Link href={"#"}><button onClick={() => {this.openNav}}><i className="fa fa-bars"></i></button></Link></div>
                 <div className={styles.menu_mobile}> 
                   {Menu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>))}
                </div>
            </header>
        );
    }
}

export default NavBarState;
